void gameLoop()
{
  while(GameInProgress == TRUE)
  {
    for(int i = 0; i < 4; i++)
    {
      enemies[i].scatter = TRUE;
      enemies[i].chase = FALSE;
    }

    Delay100ms(10);

    for(int i = 0; i < 4; i++)
    {
      enemies[i].scatter = FALSE;
      enemies[i].chase = TRUE;
    }

    Delay100ms(40);

  }
}

